import Todo from '.Todo';
import React from 'react';
import './App.css';

class App extends React.Component{
  constructor(props){
    super(props);
    this.state={
      item :{id:0, title:"Hello World 1", done:true},
    };
  }
  render(){
    return (
      <div className='App'>
        <Todo item={this.state.item} />
      </div>
    );
  }
}

export default App;
